import React from 'react';
import Box from "@material-ui/core/es/Box/Box";
import Button from "@material-ui/core/es/Button/Button";

function App() {
  return (
    <div className="App">
        <Box component="span" m={1}>
            <Button />
        </Box>
    </div>
  );
}

export default App;
